import React from 'react'

const CustomCard = (props) => {
  return (
    <div class="card text-bg-primary mb-3" style="max-width: 18rem;">
      <div class="card-header">Status: {props.status}  Zone: {props.zone}</div>
      <div class="card-body">
        <h5 class="card-title">Name: {props.name}</h5>
        <p class="card-text">Last Started: {props.LastStarted}</p>
        <br />
        <p class="card-text">Last Stopped: {props.LastStopped}</p>
      </div>
    </div>
  )
}
// lastStartTimestamp
// : 
// "2022-10-05T16:10:52.728-07:00"
// lastStopTimestamp
// : 
// "2022-10-06T00:10:16.052-07:00"
// name
// : 
// "instance-1"
// status
// : 
// "TERMINATED"
// zone
// : 
// "europe-west1-b"
export default CustomCard;
